import React from 'react';
import styled from 'styled-components';
import logo from './logo.png'
class Header extends React.Component {
    render() {
      return (
        <div >
          <Headimg src= {logo} />  
          <p></p>
        </div>
      );
    }
  }

  const Headimg = styled.img`

    height: 50px; 
    `;

  export default Header;
